import React from 'react';
import { AppBar, Toolbar, Button } from '@mui/material'; // Импортируем компоненты Material-UI
import { Link } from 'react-router-dom'; // Импортируем компонент Link для навигации

function Header() {
    return (
        <AppBar position="static">
            <Toolbar>
                <h1 className="header-title">Учет допуска работников предприятия к опасным работам</h1>
                <nav>
                    <Button color="inherit" component={Link} to="/">Home</Button>
                    <Button color="inherit" component={Link} to="/about">About</Button>
                    <Button color="inherit" component={Link} to="/contact">Contact</Button>
                    <Button color="inherit" component={Link} to="/accounting">Accounting</Button>
                </nav>
            </Toolbar>
        </AppBar>
    );
}

export default Header;
